import Item from '../dataTypes/item';

const imageUrl = "./images/helados/";

const helados: Item[] = [
/*          id|title        | description             price|url| stock*/
  new Item(1,'Chocolate'     , 'Un sabor clásico como nunca lo habías visto!' , 20,imageUrl+'Paletas/chocolate.jpg', 2),
  new Item(2,'Sambayon'         , 'Amado y odiado por muchos'      ,10   ,imageUrl+'Paletas/Vainilla.jpg', 3),
  new Item(3,'Chocolate con nueces'     , 'Un sabor que no puede faltar en tu helado', 3,imageUrl+'Paletas/nueces.jpg', 4),
  new Item(4,'Triple bendición'     , 'Solo para clientes de culto'      ,5   ,imageUrl+'Paletas/triple.jpg', 5),
  new Item(5,'Banana'      , 'O melhor sorvete do Brasil'      ,7   ,imageUrl+'recipientes/vainilla.jpg', 6),
  new Item(6,'Dulce de Leche'      , 'Tu fruta favorita en forma de helado'      ,16  ,imageUrl+'recipientes/dulce-de-leche.jpg', 7),
  new Item(7,'Mora'         , 'Ácido pero plácido!'      ,4   ,imageUrl+'recipientes/mora.jpg', 9),
];

const obtenerHelados = (): Item[] => helados;

export {obtenerHelados};
